(Scratch => {
  'use strict';

  /*!
   * Itch.io JavaScript API reference from https://static.itch.io/api.js
   * Softed by softed
   */
  var getGameData = (user, game, secret, onComplete) => {
    if (!user || !game) {
      let callback = { errors: [] };
      if (!user) callback.errors.push("missing user argument");
      if (!game) callback.errors.push("missing game argument");
      return onComplete(callback);
    }
    let url = "https://" + user + ".itch.io/" + game + "/data.json" + (secret ? "?secret=" + secret : "");
    let xhr = new XMLHttpRequest();
    xhr.open("GET", url);
    xhr.addEventListener("readystatechange", (_this => {
      return () => {
        if (xhr.readyState == 4 && typeof onComplete == "function") onComplete(JSON.parse(xhr.responseText));
      };
    })(this));
    return xhr.send();
  };

  /**
   * Used for storing the response object
   */
  let data = {};

  /**
   * Used for returning standardized error messages
   */
  let err = () => {
    if (!data.errors) return "Error.";
    let output = data.errors[1] ? "Errors: " : "Error: ";
    output += data.errors[0].charAt(0).toUpperCase() + data.errors[0].slice(1);
    for (let i = 1; true; i++)
      if (data.errors[i]) output += ", " + data.errors[i];
      else return output + ".";
  };

  /**
   * Icon by itch.io
   */
  let icon = "data:image/png;base64,";

  /**
   * Mostly visual stuff for Scratch GUI
   * The loader only uses getInfo().id and other methods
   */
  class Itch {
    getInfo() {
      return {
        id: "itch",
        name: "itch.io",
        menuIconURI: icon,
        blockIconURI: icon,
        color1: "#858585",
        color2: "#222222",
        color3: "#FA5C5C",
        blocks: [
          {
            opcode: "openItchWindow",
            blockType: Scratch.BlockType.COMMAND,
            text: "Open [prefix] itch.io [page] window with [width]width and [height]height",
            arguments: {
              prefix: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "user"
              },
              page: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "game"
              },
              width: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: "680"
              },
              height: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: "400"
              }
            }
          },
          "---",
          {
            opcode: "getGameData",
            blockType: Scratch.BlockType.COMMAND,
            text: "Fetch game data [user][game][secret]",
            arguments: {
              user: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "user"
              },
              game: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "game"
              },
              secret: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "secret"
              }
            }
          },
          {
            opcode: "getGameDataJson",
            blockType: Scratch.BlockType.REPORTER,
            text: "Return game data [user][game][secret] in .json",
            arguments: {
              user: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "user"
              },
              game: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "game"
              },
              secret: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "secret"
              }
            }
          },
          {
            opcode: "returnGameDataJson",
            blockType: Scratch.BlockType.REPORTER,
            text: "Return game data in .json"
          },
          "---",
          {
            opcode: "returnGameData",
            blockType: Scratch.BlockType.REPORTER,
            text: "Return game [data]",
            arguments: {
              data: {
                type: Scratch.ArgumentType.STRING,
                menu: "menu",
                defaultValue: "id"
              }
            }
          },
          {
            opcode: "gameBool",
            blockType: Scratch.BlockType.BOOLEAN,
            text: "Game data?"
          },
          "---",
          {
            opcode: "returnGameRewards",
            blockType: Scratch.BlockType.REPORTER,
            text: 'Return game rewards [rewards] by index:[index]',
            arguments: {
              rewards: {
                type: Scratch.ArgumentType.STRING,
                menu: "rewardsMenu",
                defaultValue: "id"
              },
              index: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 0
              }
            }
          },
          {
            opcode: "rewardsLenght",
            blockType: Scratch.BlockType.REPORTER,
            text: "Return rewards list lenght"
          },
          {
            opcode: "rewardsBool",
            blockType: Scratch.BlockType.BOOLEAN,
            text: "Rewards?"
          },
          "---",
          {
            opcode: "returnGameSale",
            blockType: Scratch.BlockType.REPORTER,
            text: "Return game sale [sale]",
            arguments: {
              sale: {
                type: Scratch.ArgumentType.STRING,
                menu: "saleMenu",
                defaultValue: "id"
              }
            }
          },
          {
            opcode: "saleBool",
            blockType: Scratch.BlockType.BOOLEAN,
            text: "Sale?"
          }
        ],
        menus: {
          menu: {
            items: [
              { text: "id", value: "id" },
              { text: "title", value: "title" },
              { text: "cover image URL", value: "cover_image"},
              { text: "price", value: "price" },
              { text: "original price", value: "original_price" }
            ]
          },
          rewardsMenu: {
            items: [
              { text: "id", value: "id" },
              { text: "title", value: "title" },
              { text: "price", value: "price" },
              { text: "amount", value: "amount" },
              { text: "amount remaining", value: "amount_remaining" },
              { text: "available", value: "available" }
            ]
          },
          saleMenu: {
            items: [
              { text: "id", value: "id" },
              { text: "title", value: "title" },
              { text: "end date", value: "end_date" },
              { text: "rate", value: "rate" }
            ]
          }
        }
      };
    }
    openItchWindow({prefix, page, width, height}) {
      let top = (screen.height - height) / 2;
      let left = (screen.width - width) / 2;
      let w = window.open("https://" + prefix + (prefix ? "." : "") + "itch.io/" + page, "", "scrollbars=1, resizable=no, width=" + width + ", height=" + height + ", top=" + top + ", left=" + left);
      if (typeof w.focus === "function") w.focus();
    }
    getGameData({user, game, secret}) {
      return new Promise(resolve => {
        getGameData(user, game, secret, response => {
          data = response;
          resolve();
        });
      });
    }
    getGameDataJson({user, game, secret}) {
      return new Promise(resolve => {
        getGameData(user, game, secret, response => {
          data = response;
          resolve(JSON.stringify(response));
        });
      });
    }
    returnGameDataJson() {
      return JSON.stringify(data) || err();
    }
    returnGameData(game) {
      return data[game.data] || err();
    }
    gameBool() {
      return data.id ? true : false;
    }
    returnGameRewards({index, rewards}) {
      try {
        return data.rewards[index][rewards];
      } catch (e) {
        return err();
      }
    }
    rewardsLenght() {
      return data.rewards ? data.rewards.lenght : 0;
    }
    rewardsBool() {
      return data.rewards ? true : false;
    }
    returnGameSale({sale}) {
      return data.sale ? data.sale[sale] : err();
    }
    saleBool() {
      return data.sale ? true : false;
    }
  }
  Scratch.extensions.register(new Itch());
})(Scratch);
